import patient from "../src/images/patientCard.jpg";
import doc from "../src/images/doctorCard.jpg";
import admin from "../src/images/adminCard.jpg";

const SData = [
    {
        imgsrc: patient,
        title: "Patient",
        link: "/PHome",
    },

    {
        imgsrc: doc,
        title: "Doctor",
        link: "/DHome",
    },

    {
        imgsrc: admin,
        title: "Admin",
        link: "/AHome",
    }
]

export default SData;
